import { CHANGE_NAME } from '../actions/index'
const initialState = {
    newName: '1'
}
export default function TabReducer(state = initialState, action) {
    console.log('來到tab reducer',)
    switch (action.type) {
        case CHANGE_NAME:
            return {
                ...state,
                newName: action.payload.newName
            }
        default:
            return state
    }
}
